import React, { Component } from 'react';

import FirstImpression from './first-impression.component';
import About from './about.component';
import Portfolio from './portfolio.component';
import { thisExpression } from '@babel/types';

class Home extends Component {
  state = {
    counters: [
      { id: 1, value: 'Blog1' },
      { id: 2, value: 'Blog2' },
      { id: 3, value: 'Blog3' },
      { id: 4, value: 'Blog4' },
      { id: 5, value: 'Blog5' },
      { id: 6, value: 'Blog6' }
    ],
    maxCounters: 3
  };
  render() {
    return (
      <div
        id="spy-wrapper"
        data-spy="scroll"
        data-target="#mainNav"
        data-offset="0"
      >
        <FirstImpression />
        <Portfolio />

        {this.state.counters
          .filter(counter => counter.id <= this.state.maxCounters)
          .map(counter => (
            <About counter={counter} />
          ))}
      </div>
    );
  }
}

export default Home;
